<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <meta http-equiv="X-UA-Compatible" content="ie=edge" />
    <title>Document</title>
    <style>
        * {
            margin: 0;
            padding: 0;
        }
        
        * {
            font-family: "Helvetica Neue", "Helvetica", Helvetica, Arial, sans-serif;
        }
        
        img {
            max-width: 100%;
        }
        
        .collapse {
            margin: 0;
            padding: 0;
        }
        
        body {
            -webkit-font-smoothing: antialiased;
            -webkit-text-size-adjust: none;
            width: 100%!important;
            height: 100%;
        }
        
        a {
            color: #c31a45;
        }
        
 
        .callout {
            padding: 15px;
            border-color: #ccc !important;
            margin-bottom: 15px;
            border-top: 1px dashed;
            border-bottom: 1px dashed;
        }
        
        .callout h1 {
            color: #532d42 !important;
            font-weight: bold
        }
        
        .callout a {
            font-weight: bold;
        }
        
        table.social {
            /* 	padding:15px; */
            background-color: #F4F5F6;
            border-bottom: 1px solid #ccc;
        }
        
        .social .soc-btn {
            padding: 3px 7px;
            font-size: 12px;
            margin-bottom: 10px;
            text-decoration: none;
            color: #FFF;
            font-weight: bold;
            text-align: center;
        }
        
        a.fb {
            background-color: #3B5998!important;
        }
        
        a.tw {
            background-color: #1daced!important;
        }
        
        a.gp {
            background-color: #DB4A39!important;
        }
        
        a.ms {
            background-color: #000!important;
        }
        
        .inline-button {
            padding: 5px 10px;
            text-decoration: none;
            cursor: pointer;
            font-size: 12px;
            line-height: 1.5;
            border-radius: 3px;
            display: inline-block;
            margin-bottom: 0;
            font-weight: 400;
            text-align: center;
            vertical-align: middle;
            cursor: pointer;
            white-space: nowrap;
            padding: 6px 12px;
            font-size: 14px;
            line-height: 1.42857143;
            border-radius: 4px;
            -webkit-user-select: none;
            color: #fff;
            background-color: #b32243;
            border-color: #512f40;
            font-weight: normal !important
        }
        
    
        
        table.head-wrap {
            width: 100%;
            border-bottom: 1px solid #ccc;
        }
        
        .header.container table td.logo {
            padding: 15px;
        }
        
        .header.container table td.label {}
        
        table.body-wrap {
            width: 100%;
        }
        
        table.footer-wrap {
            width: 100%;
            clear: both!important;
        }
        
        .footer-wrap .container td.content p {
            border-top: 1px solid rgb(215, 215, 215);
            padding-top: 15px;
        }
        
        .footer-wrap .container td.content p {
            font-size: 10px;
            font-weight: bold;
        }
        
        h1,
        h2,
        h3,
        h4,
        h5,
        h6 {
            font-family: "HelveticaNeue-Light", "Helvetica Neue Light", "Helvetica Neue", Helvetica, Arial, "Lucida Grande", sans-serif;
            line-height: 1.1;
            margin-bottom: 15px;
            color: #777;
        }
        
        h1 small,
        h2 small,
        h3 small,
        h4 small,
        h5 small,
        h6 small {
            font-size: 60%;
            color: #6f6f6f;
            line-height: 0;
            text-transform: none;
        }
        
        h1 {
            font-weight: 200;
            font-size: 30px;
        }
        
        h2 {
            font-weight: 200;
            font-size: 26px;
        }
        
        h3 {
            font-weight: 500;
            font-size: 22px;
        }
        
        h4 {
            font-weight: 500;
            font-size: 20px;
        }
        
        h5 {
            font-weight: 900;
            font-size: 16px;
        }
        
        h6 {
            font-weight: 900;
            font-size: 12px;
            text-transform: uppercase;
            color: #444;
        }
        
        .collapse {
            margin: 0!important;
        }
        
        p,
        ul {
            margin-bottom: 10px;
            font-weight: normal;
            font-size: 14px;
            line-height: 1.6;
            color: #7f8c8d
        }
        
        p.lead {
            font-size: 17px;
            margin-bottom: 30px
        }
        
        p.last {
            margin-bottom: 0px;
        }
        
        ul li {
            margin-left: 5px;
            list-style-position: inside;
        }
        
        .content {
            padding: 15px;
            max-width: 600px;
            margin: 0 auto;
            display: block;
        }
        
        .content table {
            width: 100%;
        }
        
        .column {
            width: 300px;
            float: left;
        }
        
        .column tr td {
            padding: 15px;
        }
        
        .column-wrap {
            padding: 0!important;
            margin: 0 auto;
            max-width: 600px!important;
        }
        
        .column table {
            width: 100%;
        }
        
        .social .column {
            width: 280px;
            min-width: 279px;
            float: left;
        }
        
        .clear {
            display: block;
            clear: both;
        }
        
        @media only screen and (max-width: 600px) {
            a[class="btn"] {
                display: block!important;
                margin-bottom: 10px!important;
                background-image: none!important;
                margin-right: 0!important;
            }
            div[class="column"] {
                width: auto!important;
                float: none!important;
            }
            table.social div[class="column"] {
                width: auto!important;
            }
        }
    </style>

    <body>
        <!-- HEADER -->
        <table style="width: 100%" bgcolor="#F4F5F6">
            <tr>
                <td></td>
                <td class="header container">
                    <div class="content">
                        <table bgcolor="#F4F5F6">
                            <tr>
                                <td>
                                    <img src="data:image/png;base64," width="100" />
                                </td>
                                <td align="right">
                                    <h6 class="collapse">{{date("d/M/Y")}}</h6></td>
                            </tr>
                        </table>
                    </div>
                </td>
                <td></td>
            </tr>
        </table>

        <!-- /HEADER -->

        <!-- BODY -->
        <table class="body-wrap">
            <tr>
                <td></td>
                <td class="container" bgcolor="#FFFFFF">
                    <div class="content">
                        <table>
                            <tr>
                                <td>
                                   @yield('container')

                                    <!-- social & contact -->
                                    
                                </td>
                            </tr>
                        </table>
                    </div>
                </td>
                <td></td>
                <br>
                <br>
            </tr>
        </table>
        <br>
        <br>

        <table class="social container" width="100%">
            <tr>
                <td>
                    <table style="padding:15px;">
                        <tr>
                            <td>
                                <p style="font-size:12px !important;border-bottom:1px solid #ccc;padding-bottom:15px">

                                </p>
                            </td>
                        </tr>
                    </table>
                </td>
            </tr>
            <tr>
                <td></td>
                <td  width=100%>
                    <!--- column 1 -->
                    <table  style="margin-left: 40%" class="column">
                        <tr>
                            <td>
                                <h5 class="">Connect with Us:</h5>
                                <p class="">
                                    <a href="#" class="soc-btn fb">Facebook</a>
                                    <a href="#" class="soc-btn tw">Twitter</a>
                                    <a href="#" class="soc-btn gp">Google+</a>
                                </p>
                            </td>
                        </tr>
                    </table>
                    <span class="clear"></span>
                </td>
            </tr>
        </table>

        <!-- /BODY -->
    </body>

</html>